package Second;

public class SwitchProblem {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int input = 3;
		switch (input) {
		case 2:
			System.out.println("2");
			break;
		case 1:
			System.out.println("1");
			break;
		default:
			System.out.println("3");
		}
	}

}
